import AllocatedRequesCallback from "@/components/callBackscreen/AllocatedRequesCallback";
import DetailsSection, { Header } from "@/components/tabs/DetailsSection";
import TabsContainer from "@/components/tabs/TabsContainer";
import { closeModal } from "@/redux/slices/modalSlice";
import { colors, fonts } from "@/theme";
import {
  addressDetails,
  buildingDetails,
  occupationDetails,
  personalDetails,
  suiteTypes,
} from "@/utils/constant";
import React, { useState } from "react";
import { StyleSheet, View, Text, ScrollView, Modal } from "react-native";
import { useDispatch, useSelector } from "react-redux";

const WorkSheetDetails = () => {
  const [viewMode, setViewMode] = useState("products");
  const dispatch = useDispatch();
  const isModalOpen = useSelector((state: any) => state.modal.isOpen); // Access modal state

  const handleCloseModal = () => {
    dispatch(closeModal()); // Dispatch action to close the modal
  };
  const tabs = [
    { id: "products1", label: "Products", icon: 1 },
    { id: "products2", label: "Products", icon: 2 },
  ];
  const renderComponents = {
    project: null,
    list: null,
  };

  return (
    <View style={styles.container}>
      <Header />
      <ScrollView>
        <DetailsSection title="Building Details" details={buildingDetails} />
        <DetailsSection title="Preferred Suite Types" details={suiteTypes} />

        <TabsContainer
          tabs={tabs}
          viewMode={viewMode}
          setViewMode={setViewMode}
          renderComponents={renderComponents}
        />
        <DetailsSection
          title="Purchaser Personal Details"
          details={personalDetails}
        />
        <DetailsSection
          title="Purchaser Occupation Details"
          details={occupationDetails}
        />
        <DetailsSection title="Purchaser Address" details={addressDetails} />

        <View style={{ padding: 16 }}>
          <View style={styles.section}>
            <View style={styles.sectionHeader}>
              <Text style={styles.sectionTitle}>
                Proof of Canadian Residency
              </Text>
            </View>
          </View>
        </View>

        <View style={{ padding: 16 }}>
          <View style={styles.section}>
            <View style={styles.sectionHeader}>
              <Text style={styles.sectionTitle}>Primary ID with Address</Text>
            </View>
          </View>
        </View>

        <View style={{ padding: 16 }}>
          <View style={styles.section}>
            <View style={styles.sectionHeader}>
              <Text style={styles.sectionTitle}>Primary ID with Address</Text>
            </View>
            <View>
              <Text style={styles.label}>Notes</Text>

              <Text style={[styles.detailText, { paddingTop: 8 }]}>
                Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
                enim ad minim veniam, quis nostrud exercitation ullamco laboris
                nisi ut aliquip
              </Text>
            </View>
          </View>
        </View>
      </ScrollView>

      <Modal
        visible={isModalOpen}
        transparent={true}
        animationType="slide"
        onRequestClose={handleCloseModal}
      >
        <View style={styles.modalOverlay}>
          <AllocatedRequesCallback />
        </View>
      </Modal>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: colors.formBackground,
  },
  section: {
    backgroundColor: "#FFFFFF",
    borderRadius: 8,
    padding: 16,
    paddingBottom: 20,
    marginBottom: 16,

    shadowOffset: { width: 0, height: 2 },
    shadowRadius: 4,
    elevation: 2,
  },
  sectionHeader: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 10,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 700,
    fontFamily: fonts.calibri.bold,
    textAlign: "left",
    marginTop: 12,
    marginBottom: 20,
    color: colors.primaryBlue,
  },

  detailText: {
    fontSize: 16,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
    lineHeight: 20,
    fontWeight: "400",
  },
  label: {
    fontSize: 16,
    color: colors.gray,
    fontFamily: fonts.calibri.bold,

    lineHeight: 20,
    fontWeight: "700",
  },
  modalOverlay: {
    marginTop: 40,
    flex: 1,
    justifyContent: "flex-end",
    backgroundColor: "rgba(0, 0, 0, 0.5)",
  },
});

export default WorkSheetDetails;
